</head><h1>【深基9.例1】选举学生会</h1>
<h2>题目描述</h2>
<p>学校正在选举学生会成员，有 $n$（$n\le 999$）名候选人，每名候选人编号分别从 $1$ 到 $n$，现在收集到了 $m$（$m \le 2000000$）张选票，每张选票都写了一个候选人编号。现在想把这些堆积如山的选票按照投票数字从小到大排序。</p>
<h2>输入输出格式</h2>
<h4>输入格式</h4>
<p>输入 $n$ 和 $m$ 以及 $m$ 个选票上的数字。</p>
<h4>输出格式</h4>
<p>求出排序后的选票编号。</p>
<h2>输入输出样例</h2>
<h4>输入样例 #1</h4>
<p>5 10
2 5 2 2 5 2 2 2 1 2</p>
<h4>输出样例 #1</h4>
<p>1 2 2 2 2 2 2 2 5 5</p>
